import React from "react";
import {
  Container,
  Row,
  Col,
  Card
} from "react-bootstrap";

function User() {
  return (
    <>
      <Container fluid>
        <Row>
          <Col md="8">

            <Card>
            <Card.Header>
                <Card.Title as="h5">Edit Profile</Card.Title>
              </Card.Header>

            </Card>

          </Col>
        </Row>
      </Container>
    </>
  );
}
export default User;
